Description:
            This listing is for a pair of Mary Janes in striped blue/light blue cotton size 3-6 months.
These shoes are perfect for all the little girls that will look really sweet and cool wearing it!
You can choose between many different patterns that can match with any style or colour.
This version is also suitable for summer, the shoes are all lined with pure cotton and the exterior is in pure cotton too.
They are soft soled and the sole is in denim covered by a layer of non-slip suede leather and have an elastic cotton strap that allow the fit and it's not too tight on the instep.
Perfect for first steps !
Let the feet free and the baby can walk naturally .
FEATURES :
* ANTI-SLIP SOLE ;
* HAND WASHING AND DRY FLAT ;
* FLEXIBLE SOLE;
 To choose your size you can measure from your child's heel to toe adding  1 to 1.50 cm . for growth:
0-3     months newborn                     cm 10             ( 3,93 inches ) ;
3-6      months Italian size      17-18 cm . 11.00      ( 4,33 inches ) ;
6-12    months Italian size     19-20 cm . 12.00      ( 4,72 inches ) ;
12-18  months Italian size      20-21 cm . 13.00     ( 5,11 inches ) ;
18-24  months Italian size      21-22 cm . 14.00     ( 5.51 inches ) ;
2-3      years    Italian size      22-23 cm . 15.00      ( 5,90 inches ) ;
If you like this pattern but you need another size please contact me and if it's still available I will be happy to make a pair expressely for you.
